import React from 'react'

const Home = () => (
  <div className='home'>
	<h1>Welcome to my portfolio website</h1>
	<p> Feel free to browse around and learn more about me.</p>
	<img
        src="favion.png"
        height="30"
      />
  </div>
);

export default Home;
